// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

// Importing the Chainlink AggregatorV3Interface for interacting with price feeds
import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

library PriceConverter {
    // Function to retrieve the latest price of ETH in USD from Chainlink
    function getPrice() internal view returns (uint256) {
        // Create an instance of the Chainlink price feed for ETH/USD
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            0x694AA1769357215DE4FAC081bf1f309aDC325306
        );

        // Retrieve the latest price data
        (
            ,
            /* uint80 roundID */
            int256 answer, // Price of ETH in USD (scaled by 1e8) /* uint256 startedAt */
            ,
            ,

        ) = /* uint256 timeStamp */
            /* uint80 answeredInRound */
            priceFeed.latestRoundData();

        // Convert the price to match the 1e18 format of ETH (wei)
        return uint256(answer * 1e10); // Scale up by 10^10 to get price in wei
    }

    // Function to get the version of the Chainlink price feed contract
    function getVersion() internal view returns (uint256) {
        // Return the version of the price feed contract
        return
            AggregatorV3Interface(0xfEefF7c3fB57d18C5C6Cdd71e45D2D0b4F9377bF)
                .version();
    }

    // Function to convert a given amount of ETH to its equivalent USD value
    function getConversionRate(uint256 ethAmount)
        internal
        view
        returns (uint256)
    {
        // Get the current price of ETH in USD
        uint256 ethPrice = getPrice();

        // Calculate the equivalent USD value of the ETH amount
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18;

        // Return the equivalent USD value
        return ethAmountInUsd;
    }
}

